import React from 'react';

class Contador extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0
    }
  }
  render() {
    return (
      <div className="counter">
        <div className="count">
          {this.state.count}
        </div>
      </div>
    )
  }
}

export default Contador;
